INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (1, 2, "調子が上がって\nきたなっ", 3000, 2, "vo_minigame_1013_icon_2_002_001", "vo_minigame_1013_icon_1_002_001", "訓練はまだ\nここからですわ", 2, 1000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (2, 2, "ほらほら、\nまだいけるだろ？", 3000, 2, "vo_minigame_1013_icon_2_003_001", "vo_minigame_1013_icon_1_003_001", "クスクス、悪くない\n流れですわね", 2, 5000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (3, 2, "へへっ、おまえら\nやるじゃねえか！", 3000, 2, "vo_minigame_1013_icon_2_004_001", "vo_minigame_1013_icon_1_004_001", "すばらしい\n記録ですわ", 3, 10000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (4, 3, "あたしたちはまだ\n止まらねえぜ！", 3000, 2, "vo_minigame_1013_icon_2_005_001", "vo_minigame_1013_icon_1_005_001", "乗りに乗って\nいますわね", 3, 10000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (5, 3, "見てろよ！\nマコト班の快進撃だ！", 3000, 2, "vo_minigame_1013_icon_2_005_002", "vo_minigame_1013_icon_1_005_002", "まだまだ行きます\nついてきなさい", 3, 10000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (6, 3, "うおぉぉっ！\n絶好調だぜ！", 3000, 2, "vo_minigame_1013_icon_2_005_003", "vo_minigame_1013_icon_1_005_003", "エリコ班の\n本領発揮ですわ！", 3, 10000);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (7, 4, "どこまで行けるか\n楽しみだなっ！", 3000, 2, "vo_minigame_1013_icon_2_006_001", "vo_minigame_1013_icon_1_006_001", "ここからは\n前人未到の領域です！", 3, 0);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (8, 5, "まだ諦めんなよっ", 1000, 3, "vo_minigame_1013_icon_2_007_001", "vo_minigame_1013_icon_1_007_001", "厄介でしたわ…", 4, 1);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (9, 5, "冷やっとしたぜ…！", 1000, 3, "vo_minigame_1013_icon_2_007_002", "vo_minigame_1013_icon_1_007_002", "油断大敵です", 4, 1);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (10, 5, "弱音を吐くなっ", 1000, 3, "vo_minigame_1013_icon_2_007_003", "vo_minigame_1013_icon_1_007_003", "忌々しいっ…", 4, 1);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (11, 6, "マコト班集合！", 1500, 4, "vo_minigame_1013_icon_2_008_001", "vo_minigame_1013_icon_1_008_001", "大所帯ですわね", 3, 99);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (12, 6, "連携してくぞ！", 1500, 4, "vo_minigame_1013_icon_2_008_002", "vo_minigame_1013_icon_1_008_002", "エリコ班へようこそ", 3, 99);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (13, 8, "みんなに力を！", 3000, 1, "vo_minigame_1013_icon_2_020_001", "vo_minigame_1013_icon_1_020_001", "ナナカちゃんに\nお任せあれ", 6, 0);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (14, 9, "任せてくれたまえ", 3000, 1, "vo_minigame_1013_icon_2_022_001", "vo_minigame_1013_icon_1_022_001", "はっはっは！\n任せろ！", 7, 0);
INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (15, 10, "ほな、いきまひょか", 3000, 1, "vo_minigame_1013_icon_2_023_001", "vo_minigame_1013_icon_1_023_001", "どんどんいくわよ", 8, 0);
